insert into Produto (id, nota, avaliacoes, categoria, nome, descricao, preco, quantidadeEmEstoque, urlFoto) values (1, 5, 1, 'Eletrônicos', 'Smart TV LED 32 Samsung UN32J4300', 'A Smart TV LED UN32J4300 Samsung conta com Wi-Fi integrado, ou seja, permite o acesso à internet sem a necessidade de nenhum acessório extra. Você tem acesso a uma série de conteúdos, que vão desde música e filmes até os mais diversos tipos de aplicativos. <br>Além disso, ela também conta com recursos como o Screen Mirroring, com o qual você pode desfrutar de conteúdos de dispositivos Móveis na sua TV e como o Connect Share Movie, que permite que você conecte um pen drive ou um disco rígido e curta filmes, fotos ou músicas! Com o Modo Futebol é como se você estivesse realmente no jogo. Ele exibe, de forma precisa e viva, a grama verde do campo e todas as outras cores do estádio. Um poderoso efeito de som multi-surround também permite que você ouça toda a empolgação.', 1281.55, 25, 'http://i.mlcdn.com.br/470x352/smart-tv-led-32-samsung-un32j4300conversor-integrado-dtv-2-hdmi-1-usb-wi-fi-193365700.jpg')
